def companyName(csv_file):
    """ get a list of company names from csv file """
    with open(csv_file, newline='') as file:
        spamr = csv.reader(file)
        name_list = []
        for row in spamr:
            name_list.append(row[0].lower())
    
    return name_list


def removeCpanyName(text):
    """ it's used in textNormalization() """
    name_list = companyName('a.csv')
    #name_list = list(get_json_gsc())
    text = text.lower()
    for elm in name_list:
        if elm in text:
            text = text.replace(elm, '')
    return text







def get_nameInFrom(chaine):
    """ name extraction in 'from' """
    _l = chaine.split(' ')
    _p = ' '.join(_l[:len(_l)-1])
    if '|' in _p:
        _a = _p.split('|')[0]

        if '-' in _a:
            return _a.strip('\"').split('-')
        return _a.strip('\"').split('&')
    
    else:
        if '-' in _p:
            return _p.strip('\"').split('-')
        return _p.strip('\"').split('&')
    


def rmNameInEmail(text, _from):
    """ remove name in email. it's used in main()"""
    name = get_nameInFrom(_from)
    _name = [n.strip().lower() for n in name]
    text = text.lower()
    for elm in _name:
        if elm in text:
            #print(elm)
            text = re.sub(elm, '', text)
        else:
            pass    
    return text



def removeLocation(text):
    place_t = locationtagger.find_locations(text=text)
    location_set = set(place_t.countries+place_t.regions+place_t.cities+place_t.other_countries+place_t.other_regions+place_t.other)
    location_list = list(location_set)
    location_t = [str(elm.lower()) for elm in location_list]
    text = text.lower()
    for elm in location_t:
        if elm in text:
            text = re.sub(elm, '', text)
        else:
            pass
    return text 


def rmDuplicateEmail(data_list):
    """ a function to remove any duplicate emails
        it's used in main() 
    """
    data = list(
        {
            dico['body']: dico
            for dico in data_list
        }.values()
    )
    return data




#you can test this
def lowerCase(text):
    return text.lower()


def is_date(word):
    exp = r'\d{2}.\d{2}.\d{4}'
    if re.search(exp, word) is None:
        return False
    else:
        return True



def is_url(word):
    thing = urlparse(word.strip())
    if (thing.scheme and thing.netloc):
        
        return True
    else:
        return False
   


def is_email(word):
    exp = r"\b[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Z|a-z]{2,}\b"

    if re.search(exp, word) is None:
        return False
    else:
        return True




#you can test this
def normalizeEmailUrlDate(text):
    """ normalize email, url and date """
    out = []
    for word in text.split(' '):
        if is_date(word):
            word = 'date'
        if is_url(word):
            word = 'httpaddress'
        if is_email(word) or '@.com' in word or '.com' in word:
            word = 'emailaddr'
        out.append(word)
        _text = ' '.join(out)
    return _text





#you can test this
def expendContractions(text):
    """ expend contractions phrase before removeStopWords """
    return contractions.fix(text)   






#you can test this
def normalizeNumDollar(text):
    dollar_exp = re.compile(r'\$')
    number_exp = re.compile(r'\d+')
    text1 = re.sub(dollar_exp, 'Dollar', text)
    text = re.sub(number_exp,'number',text1)
    return text 



#you can test this
def rm_special_char(text):
   
    tokens = tokenizeText(text)
    expression = re.compile('[{}]'.format(re.escape(string.punctuation)))
    _filter = filter(None, [expression.sub('', token) for token in tokens])
    _text = ' '.join(_filter)
    return _text



#you can test this
def rm_punctuation(text):
    exp = re.compile(r'[^\w\s.]')
    text = re.sub(exp,'', text)
    return text





def tokenizeText(text):
    words = word_tokenize(text)
    tokens = [word.strip() for word in words]
    return tokens


#you can test this
def removeStopWords(text):
    tokens = tokenizeText(text)
    _filter = [token for token in tokens if token not in stopwords_list]
    _text = ' '.join(_filter)
    return _text






def pos_tagger(text):
    tag_map = {
      "J":wn.ADJ,
      "V":wn.VERB,
      "N":wn.NOUN,
      "R":wn.ADV
    }
    text = tokenizeText(text)
    tagged_t = nltk.pos_tag(text)
    wn_tagged_t = [(word.lower(), tag_map[pos_tag[0]]) if pos_tag[0] in tag_map else (word.lower(), None) for word, pos_tag in tagged_t]
    return wn_tagged_t  



#you can test this
def lemmatizeText(text):
    tagged_text = pos_tagger(text)
    lem_tokens = [lemmatizer.lemmatize(word, pos_tag) if pos_tag else word for word, pos_tag in tagged_text]
    _text = ' '.join(lem_tokens)
    return _text



#you can test this
def stemText(text):
    tokens = tokenizeText(text)
    stemmed_tokens = [stemmer.stem(token) for token in tokens]
    stemmed_t = ' '.join(stemmed_tokens)
    return stemmed_t




def textNormalization(text):
    text = removeCpanyName(text) # remove company name
    text = removeLocation(text) #remove cities, regions, states, and countries
    text = lowerCase(text) #Lower Case entire text
    text = normalizeEmailUrlDate(text) #Normalize URLS and Url 
    text = normalizeNumDollar(text) #Normalize number and $
    
    text = expendContractions(text) # expend contractions words
    text = rm_punctuation(text) # remove punctuation
    text = rm_special_char(text) # Remove punctuation and special characters

    text = removeStopWords(text) 
    text = lemmatizeText(text)
    text = stemText(text)
    
    return text



